import React from 'react';
import './FilmPoster.css';
import FilmName from './Filmname.js';
import IMAGE from './img/img.js';



class Filmposter extends React.Component{
    render(){
        return (
        <div className="filmposter">
        <img className='poster' src={<IMAGE image="1.jpeg"/>} alt="academy"/>
            <FilmName text='Великая война'/>
        </div>
        );
    }
}

export default Filmposter;
